import {Component} from 'react'

class PhonesList extends Component{

    constructor(){
        super()
        this.state = {
            phones: undefined
        }
        this.phonesService = new this.phonesService()
    }

    componentDidMount = () =>{
        this.phonesService()
    }


    render(){
        return (

            this.state.phones===undefined
            ?
            <h1>The list goes here...</h1>
            :
            this.state.phones.map(phone => <h1>{phone.name}</h1>)

        )
    }

}

export default PhonesList
